    return (
        <div className="app">
            <h1>
                代購專用
            </h1>
            <NavigationBar></NavigationBar>
            <section>
                <h2>
                    簡介
                </h2>
            </section>
        </div>


    )
}

const NavigationBar = () => {
    return (
        <div>
            <menu className="menu">
                <TopButton> ITZY </TopButton>
                <TopButton> (G)I-DLE </TopButton>
                <TopButton> LE SSERAFIM </TopButton>
            </menu>
        </div>
    );
}


export default Home
